import TableRow from "./TableRow"


const MarkTable = ({students}) =>
{

    return(
        <div>
            {students.length
            ? console.log(students)
            : console.log('empty')
            }
            <TableRow mark={"10"} name={"Давыдовский Дмитрий"}/>
        </div>
    )
}

export default MarkTable;
